        public override void GenerarSucesores(int nodo,ref List<int> abiertos,ref List<int> nodosSeleccionados, ref Dictionary<int, int> camino)
        {
            int i,j;
            int NUM = 189;
            //obtener adyacencias
            int contAdya = 0,band=0;
            int[] suce = new int[NUM];

            for (i = 0; i <= NUM; i++)
            {
                if (matrizCostos[nodo, i] != 0 && matrizCostos[nodo, i] != Infinito)
                {
                    suce[contAdya] = i; //guarda el nodo (posicion)
                    contAdya++; // arreglo de adyacencias
                }
            }


            //inserta sucesion en abiertos si no estuvo antes visitado
            for (i = 0; i < contAdya; i++)
            {
                for (j = 0; j < nodosSeleccionados.Count; j++)
                {
                    if (suce[i] == nodosSeleccionados[j])
                        band = 1;
                }
                if (band == 1)
                {
                    band = 0;
                }
                else
                {
                    //evitar repeticiones de nodos
                    nodosSeleccionados.Add (suce[i]);
                    camino[suce[i]] = nodo;
                    abiertos.Add(suce[i]);
                }

            }
        }
