        {
            
            int i, j;
            int contAdya = 0, band = 0;
            int[] suce = new int[4];

            for (i = 0; i < 6; i++)
            {
                for (j = 0; j < 14; j++) {
                    if (grafo[i,j] == nodo)
                    {
                        //sur
                        if (i + 1 < 6 && grafo[i + 1, j] != 0)
                        {
                            suce[contAdya] = grafo[i + 1, j];
                            contAdya++;
