                        //norte
                        if (i - 1 >= 0 && grafo[i - 1, j] != 0)
                        {
                            suce[contAdya] = grafo[i - 1, j];
                            contAdya++;
                        }
                         //oeste
                        if (j - 1 >= 0 && grafo[i, j - 1] != 0)
